import { Container } from 'react-bootstrap'
import {BrowserRouter ,Routes, Route} from 'react-router-dom'

import Header from "./components/Header";
import Footer from "./components/Footer";
import HomePage from "./pages/HomePage"

function App() {
  return (

    <div>
    <Header />
    <main className='py-3'>
    <BrowserRouter>
    <Routes>
      <Container>
      <Route path='/'/>
      </Container>
      </Routes>
      </BrowserRouter>
    </main>
    <Footer/>

    </div>

  );
}

export default App;
